var map = L.map('map');
var zoomax = 18;
var serverIP = '';

var openstreetUrl = 'http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png';
var openstreet = new L.tileLayer(openstreetUrl, {maxZoom: zoomax});

var googleSat = L.tileLayer('http://{s}.google.com/vt/lyrs=s&x={x}&y={y}&z={z}',{
    // maxZoom: 20,
    subdomains:['mt0','mt1','mt2','mt3']
});


var baseLayers = {
  "Satellite": googleSat,
  "openstreetmap": openstreet,
  };
var overlays = {

  };
L.control.layers(baseLayers, overlays).addTo(map);

map.addLayer(openstreet);
map.setView([37.826,-122.24],13);



function style(feature) {
	if(feature.properties.wiki == "yes") {
		return {
		 color: '#bf3eff',
         weight: 2.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
	}
	else {
    	return {
         color: '#0E6FF4',
         weight: 2.5,
         opacity: 0.9,
         fillOpacity: 0.1
        }
    }
};

function highlightFeature(neighborhood) {
	var layer = neighborhood.target;
	layer.setStyle ({
		weight: 5,
        color: '#FFD700',
        fillOpacity: 0.3
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

function resetHighlight(neighborhood) {
    geojson.resetStyle(neighborhood.target);
}

function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
    })	
    if (feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
}

var geojson = L.geoJson(myData, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);

var legend = L.control({position: 'topleft'});
    
    legend.onAdd=function (map) {

        // create the container with a particular class name
        	var wikiBox = L.DomUtil.create('element','wiki_box')
        		wikiBox.innerHTML += "<br /><b><i>Wikipedia Coverage<i><b>"; 
    return wikiBox;

 };
 legend.addTo(map);

L.control.scale().addTo(map);

var legends = L.control({position: 'topleft'});
    
    legends.onAdd=function (map) {
        // create the container with a particular class name
		var other = L.DomUtil.create('div','other')
        	other.innerHTML += "<br /><b><i><p>Other Coverage</p><i><b>"; 
    return other;
 };
 legends.addTo(map);








